import React from 'react';
import './App.css';
import logo from '../assets/finMap-logo.png';

function App() {
  return (
    <div className="App">
      <h1>Welcome to FinMap</h1>
      <div className='head-image'></div>
      <image src={logo} alt='FinMap Logo' />
    </div>
  );
}

export default App;
